import React from 'react';
import './App.css';
import Home from './Component/home';

class App extends React.Component {
	constructor(props) {
		super(props);
		this.state = localStorage.getItem('token');
	}

	/** Render this app first app component run */
	render() {
		return(
			<div>
			<h1>Hello</h1>
			</div>
			)
	}
}
export default App;
